import './App.css';
const ans1 = "Gengster Burger";

function Questions({value}){
  return (<>
    <label>{value}</label>
    <br></br>
    <input type="text" ></input></>
  );
}

function Q1() {
  let q1 = document.getElementById("q1")
  q1.addEventListener("keydown", e => {
    if (e.key == "enter") {
      alert("Enter");
    }
  })
}

function App() {
  Q1();
  return <Questions id="q1" className="q1" value="What is my nickname masa sekolah rendah?"/>;
}

export default App;
